import React from 'react';

const Shopp = () => {
  return (
    
    <div>
      <h2>Track Your Order</h2>
      <p>Enter your order details to track your shipment.</p>
    </div>
    
  );
};import Shop from "../components/shops/Shop"; // Import Shop component

const TrackPage = ({ shopItems, addToCart }) => {
  return <Shop shopItems={shopItems} addToCart={addToCart} />;
};

export default Shopp;
